import { useEffect, useState } from 'react';
import './StudentSchedule.css';
function StudentSchedule() {
    const [schedule, setSchedule] = useState([]);

    // Giả lập lấy lịch học từ server
    useEffect(() => {
        // Thay thế bằng API thực tế
        const mockSchedule = [
            { day: 'Thứ Hai', time: '08:00 - 10:00', subject: 'Toán' },
            { day: 'Thứ Ba', time: '10:00 - 12:00', subject: 'Lý' },
            { day: 'Thứ Tư', time: '14:00 - 16:00', subject: 'Hóa' },
        ];
        setSchedule(mockSchedule);
    }, []);

    return (
        <div className="schedule">
            <h2>Lịch học</h2>
            <table>
                <thead>
                    <tr>
                        <th>Ngày</th>
                        <th>Giờ học</th>
                        <th>Môn học</th>
                    </tr>
                </thead>
                <tbody>
                    {schedule.map((item, index) => (
                        <tr key={index}>
                            <td>{item.day}</td>
                            <td>{item.time}</td>
                            <td>{item.subject}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default StudentSchedule;
